const margin = {{top: 20, right: 20, bottom: 40, left: 50}};
const width = 800 - margin.left - margin.right;
const height = 480 - margin.top - margin.bottom;

const svg = d3.select("#chart").append("svg")
    .attr("viewBox", [0,0, width + margin.left + margin.right, height + margin.top + margin.bottom]);

const g = svg.append("g").attr("transform", `translate(${{margin.left}},${{margin.top}})`);

// scales
const x = d3.scaleLinear().domain([0,10]).range([0,width]);
const y = d3.scaleLinear().domain([0,10]).range([height,0]);

// axes
g.append("g").attr("class","axis")
  .attr("transform", `translate(0,${{height}})`)
  .call(d3.axisBottom(x).ticks(10));

g.append("g").attr("class","axis")
  .call(d3.axisLeft(y).ticks(10));

g.append("text")
  .attr("class","label")
  .attr("x", width/2)
  .attr("y", height + 35)
  .attr("text-anchor","middle")
  .text("Bank Internal Score");

g.append("text")
  .attr("class","label")
  .attr("transform","rotate(-90)")
  .attr("x",-height/2)
  .attr("y",-40)
  .attr("text-anchor","middle")
  .text("FinScore Telco");

const dot = g.selectAll(".dot")
  .data(data)
  .enter().append("circle")
  .attr("class","dot")
  .attr("cx", d=>x(d.bank))
  .attr("cy", d=>y(d.telco))
  .attr("r", 3)
  .attr("fill", "#bbb")
  .attr("opacity",0.8);

const headline = svg.append("text")
  .attr("class","counter")
  .attr("x", margin.left)
  .attr("y", 18)
  .text("");

const counters = {{
  acceptance: svg.append("text").attr("class","counter").attr("x", margin.left).attr("y", 40),
  defaultRate: svg.append("text").attr("class","counter").attr("x", margin.left).attr("y", 60)
}};

function update(threshold) {{
  document.getElementById("thresholdVal").textContent = threshold;
  const accepted = data.filter(d => d.bank >= 5 && d.telco >= threshold);
  const acceptance = accepted.length / data.length;
  const defaultRate = accepted.length ? d3.mean(accepted, d=>d.default) : 0;

  dot.transition().duration(400)
     .attr("fill", d => (d.bank>=5) ? (d.telco>=threshold ? (d.default ? "#e74c3c" : "#2ecc71") : "#3498db") : "#ccc")
     .attr("opacity", d => (d.bank>=5 ? 1 : 0.15));

  counters.acceptance.text(`Acceptance: ${(acceptance*100).toFixed(1)}%`);
  counters.defaultRate.text(`Default rate: ${(defaultRate*100).toFixed(1)}%`);

  headline.text(threshold==0 ? "Bank-only decision (bank ≥ 5)" : `Blended rule (bank ≥ 5 & telco ≥ ${threshold})`);
}}

update(0);

// slider interaction
d3.select("#telcoSlider").on("input", function(e) {{
  const t = +this.value;
  update(t);
}});

// autoplay slider up & down
let direction = 1;
setInterval(()=>{{
  const slider = document.getElementById("telcoSlider");
  let val = +slider.value;
  if(val===10) direction=-1;
  if(val===0) direction=1;
  val += direction;
  slider.value = val;
  update(val);
}}, 3000);

</script>
